import { useEffect, useState } from "react";

import { signOut,getAuth } from "firebase/auth"
import { initializeApp } from "firebase/app";
import { Link,useNavigate } from "react-router-dom";
import axios from "axios";

import "./Home.css"





function EmpData1(event) {
    const [data, setData] = useState([])
    const[value,setValue]=useState("")


    const navigate=useNavigate()
    const firebaseConfig = {
        apiKey: "AIzaSyBmbt0GWdLp3LfPsR0foJZMFQysZfJmkmo",
        authDomain: "narasimha-4cf38.firebaseapp.com",
        projectId: "narasimha-4cf38",
        storageBucket: "narasimha-4cf38.appspot.com",
        messagingSenderId: "931387859079",
        appId: "1:931387859079:web:f9e2c4cc056cbf78c51822",
        measurementId: "G-FP2FFCJCJL"
    };
    const app=initializeApp(firebaseConfig)
    const auth = getAuth()

    const SubmitData=(event)=>{

        event.preventDefault()

        signOut(auth)
        .then(()=>{
            alert("log out succesfully")
             navigate("/login")
        })
        .catch(()=>{
            alert("error")
        })
    }



    

    useEffect(() => {

        fetch("http://localhost:3006/subscription")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                // console.log(resp)
                setData(resp)
            })
    }, [])

   

    const search=async(lkj)=>{
     lkj.preventDefault()
        return await axios. get(`http://localhost:3006/subscription?q=${value}`)
        .then((go)=>{
          setData(go.data)
        })
        .catch((err)=>{
            console.log(err)
        })
    }







    return (
        <div>
            <nav className="navbar bg-dark border-bottom border-body" data-bs-theme="dark" >
                
                    <div className="container-fluid">
                        <a className="navbar-brand">Navbar</a>
                        <a className="navbar-brand">HOME</a>
                        <a className="navbar-brand">CART:</a>
                       
                        <form className="d-flex" role="search" onSubmit={search}>
                            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" value={value} onChange={(s)=>setValue(s.target.value)} />
                            <button className="btn btn-outline-success" type="submit">Search</button>
                        </form>
                        <button className="btn btn-outline-success" onClick={SubmitData} type="text">logout</button>
                    </div>
            </nav>

            <h1 style={{ textAlign: "center" }}>CLOTHES FOR MENS & WOMENS</h1>
            <div id="sun" >


                {data.map((item) => (
                    <div className="card" style={{ width: "18rem" ,boxShadow:"gray 5px 5px 5px"}}>

                        <img src={item.img} class="card-img-top" alt="..." style={{ height: "250px",}} />

                        <div className="card-body">

                            <h5 className="card-title">{item.brand}</h5>
                            <p className="card-text">{item.size}</p>
                            <p>{item.description}</p>
                            <h3 >Rs: {item.price}</h3>
                            <a href="#" className="btn btn-primary">Add To Cart (+)</a>
                        </div>
                        
                    </div>
                    
                ))}
                <div class="card-group">
  <div class="card">
    <img src="..." class="card-img-top" alt="..."/>
    <div class="card-body">
      <h5 class="card-title">Card title</h5>
      <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
      <p class="card-text"><small class="text-body-secondary">Last updated 3 mins ago</small></p>
    </div>
  </div>
  <div class="card">
    <img src="..." class="card-img-top" alt="..."/>
    <div class="card-body">
      <h5 class="card-title">Card title</h5>
      <p class="card-text">This card has supporting text below as a natural lead-in to additional content.</p>
      <p class="card-text"><small class="text-body-secondary">Last updated 3 mins ago</small></p>
    </div>
  </div>
  <div class="card">
    <img src="..." class="card-img-top" alt="..."/>
    <div class="card-body">
      <h5 class="card-title">Card title</h5>
      <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This card has even longer content than the first to show that equal height action.</p>
      <p class="card-text"><small class="text-body-secondary">Last updated 3 mins ago</small></p>
    </div>
  </div>
</div>
            </div>
        </div>


    )
}

export default EmpData1;
